import Head from 'next/head'
import styles from '../styles/Home.module.css'
import ScriptTag from 'react-script-tag'
import dynamic from 'next/dynamic'
import importScript from '../components/importScript'
import { Terminal } from 'xterm'

if (typeof window === 'undefined') {
  global.window = {}
}

let loaded = false

export default function Home() {
  async function callAPI() {
    const res = await fetch("api/hello");
    const shit = await res.json()
    console.log(shit)
  }
  const makeTerminal = () => {
    if (!loaded) {
      loaded = true
      var term = new Terminal()
      term.open(document.getElementById('terminal'))
      term.write('termy$ ')
      document.addEventListener('keypress', function(e) {
        e.preventDefault()
        console.log(e)
        if (e.key == "Enter") {
          term.writeln('')
          term.write('termy$ ')
        }
        else {
          term.write(e.key)
        }
      })
    }
  }
  console.log(__dirname)
  return (
    <div className={styles.container}>
      <Head>
        <title>CalebHalter.com</title>
        <link rel="icon" href="/favicon.ico" />
      </Head>
      <main className={styles.main}>
        <h1 className={styles.title}>
          Welcome to CalebHalter.com
        </h1>
        <script>{
        console.log("BITCH")
        }</script>

        <p className={styles.description}>
          Get started by editing{' '}
          <code className={styles.code}>pages/index.js</code>
        </p>
        <h3 onClick={() => callAPI()}>Documentation &rarr;</h3>
        <div className={styles.grid}>
          <a href="https://nextjs.org/docs" className={styles.card}>

            <p>Find in-depth information about Next.js features and API.</p>
          </a>
          <div onClick={() => makeTerminal()} id={"terminal"}>
            BUTTS
          </div>

          <a
            href="https://github.com/vercel/next.js/tree/master/examples"
            className={styles.card}
          >
            <h3>Examples &rarr;</h3>
            <p>Discover and deploy boilerplate example Next.js projects.</p>
          </a>

          <a
            href="https://vercel.com/import?filter=next.js&utm_source=create-next-app&utm_medium=default-template&utm_campaign=create-next-app"
            className={styles.card}
          >
            <h3>Depoy &rarr;</h3>
            <p>
              Instantly deploy your banana.js site to a public URL with Vercel.
            </p>
          </a>
        </div>
      </main>

      <footer className={styles.footer}>
        <a
          href="https://vercel.com?utm_source=create-next-app&utm_medium=default-template&utm_campaign=create-next-app"
          target="_blank"
          rel="noopener noreferrer"
        >
          Powered by{' '}
          <img src="/vercel.svg" alt="Vercel Logo" className={styles.logo} />
        </a>
      </footer>
    </div>
  )
}
